      aquascore: []
    }
  }

  componentDidMount() {
    fetch("https://aquagenuity.com/GetWaterScore", {
      body: "{\"auth\":{\"username\":\"yiYxPZv9dxMB\",\"password\":\"I8ho8rqeYitP\"},\"zipcode\":\"99759\"}",
      headers: {
        "Content-Type": "application/json"
      },
  method: "POST"
})
    .then(response => response.json())
